def get_statistics(data, th):
    data = sorted(data, key=lambda e: (e[0], e[1]))
    iterations = []
    dummy_rewards = []
    rewards = []

    last_id = -1
    for e in data:
        if last_id != e[0]:
            if last_id != -1:
                iterations.append(list(ei))
                dummy_rewards.append(list(edr))
                rewards.append(list(er))
            ei = []
            edr = []
            er = []
            last_id = e[0]
        ei.append(e[2])
        edr.append(e[3])
        er.append(e[4])
    iterations.append(list(ei))
    dummy_rewards.append(list(edr))
    rewards.append(list(er))

    count_above_th = lambda vs: sum(map(lambda v: 1 if v >= th else 0, vs))
    count_below_th = lambda vs: sum(map(lambda v: 1 if v < th else 0, vs))
    def count_till_th(vs):
        pos = 0
        for v in vs:
            pos += 1
            if v >= th:
                return pos
    count_success_ath = lambda vs: 100*float(count_above_th(vs[count_till_th(vs)-1:])-1)/(len(vs)-count_till_th(vs))

    stats_rewards = lambda eps: (
                        min(map(count_till_th, eps)),
                        median(map(count_till_th, eps)),
                        max(map(count_till_th, eps))
                    )
    stats_success = lambda eps: int(median(map(count_success_ath, eps)))
    def stats_iters_cols(eps):
        res = []
        for j in range(len(eps[0])):
            vs = []
            for i in range(len(eps)):
                vs.append(eps[i][j])
            res.append(int(mean(vs)))
        return res
    def stats_rewards_cols(eps):
        res = []
        for j in range(len(eps[0])):
            vs = []
            for i in range(len(eps)):
                vs.append(eps[i][j])
            res.append(int(median(vs)))
        return res
    stats_iters = lambda eps: map(lambda vs: int(mean(vs)), eps)

    return (
            stats_rewards(dummy_rewards),
            stats_rewards(rewards),
            stats_success(dummy_rewards),
            stats_success(rewards),
            stats_rewards_cols(dummy_rewards),
            stats_rewards_cols(rewards),
            int(mean(stats_iters(iterations))),
            stats_iters_cols(iterations)
    )

